import styled from "styled-components";

export const CardListContainer = styled.div`
    width: 85vw;
    margin: 0 auto;
    display: grid;
    grid-template-columns: repeat(auto-fit, minmax(18rem, 1fr));
    grid-gap: 2em;
    padding-bottom: 2.5em;
`
